  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:20.104180\",\n\t\"name\": \"erie-national-wildlife-refuge-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Erie National
  Wildlife Refuge outlines Refuge accomplishments for the 1985 calendar year. The
  report begins by giving a brief introduction to the Refuge and describing the climate
  and habitat conditions in the Refuge, as well as land acquisition, and planning.
  The administration section discusses personnel, youth programs, funding, and safety.
  The habitat management section discusses wetlands, forests, croplands, grasslands,
  haying, fire management, pest control, and wilderness and special areas. Wildlife-
  including endangered and threatened species, migratory birds, game mammals, fisheries
  resources, animal control, and marking and banding- are discussed. The public relations
  sections describes information and interpretation, recreational uses, and law enforcement.
  The construction and maintenance section describes recent construction, rehabilitation,
  maintenance, equipment replacement, and energy conservation. Cooperative programs
  are discussed. Photographs and brochures are attached.\",\n\t\"license_title\":
